import React, { useEffect, useState } from 'react'
import Navbar from '../../components/navbar/Navbar'
import './Dorms.css';
import { useSelector, useDispatch } from 'react-redux'
import { useNavigate, useParams } from "react-router-dom";
import { getDormById } from '../../actions/dorms';
import '../School/stars.css'
import ReactMapGL from 'react-map-gl'
function Dorms() {
  const navigate = useNavigate();
  const dispatch = useDispatch()
  let { id } = useParams();
  console.log(id)
  let [viewport, setviewport]=useState({
    latitude:30,
    longitude:32,
    zoom:8,
    width:50,
    height:200

  })


  const dorms = useSelector((state) => state.dorms)
  console.log(dorms)

  useEffect(() => {
    dispatch(getDormById(id));
  }, [dispatch]);
  return (

    <div>
      <Navbar />
      {/* <center>
        <h1>ボールを食べる</h1>
        <h2>INSANELY COOL DORM CHIEF</h2>
        <p>Plan:</p>
        <ul>
          <li>Dorm info (photo rating...) on the left</li>
          <li>Reviews of the dorm on the right</li>
          Get dorm from id that is in the url
        </ul>

      </center> */}
      <center className='headersi'><h1 ><strong>{dorms.Name}</strong> reviews</h1></center>
      <ReactMapGL
        mapboxAccessToken={'pk.eyJ1Ijoid2FmaWNraCIsImEiOiJjbGNuZ2ttcnoxMm83M25zOTM0cGpkanlmIn0.8U0pDk8RKlhvQrxzgWsbxQ'}
       {...viewport} onViewChange={(newView)=>setviewport(newView)}>

      </ReactMapGL>
      <div className="Flexing">
      <div className="sectionA">
        <img src={dorms.images} alt="BIGNONON" />
          <p class="starability-result" data-rating={dorms.Rating}>
          </p>

      </div>

      </div>
    </div>
  )
}
export default Dorms
